import React, { Component } from 'react';
import { Box, Button } from 'grommet';

class Header extends Component {
	render() {
		return (
			<Box
				direction="row"
				gap="medium"
                pad={{ vertical: 'medium', left: 'medium' }}
                background=""
			>
				<Button>Generate New Array</Button>
			</Box>
		);
	}
}

export default Header;
